  render() {
    return (
      <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <Project />
          </Route>
          <Route path="/users">
            <Header />
          </Route>
          <Route path="/">
            <Footer />
          </Route>
        </Switch>
      </div>
    </Router>
    );
  }
}

export default App;
